@motogp | Pedrosa to make MotoGP wildcard appearance

MotoGP Legend Dani Pedrosa will return to the racetrack and will make a competitive debut with the KTM RC16 at the Red Bull Ring for the #StyrianGP

@redbullmotorsports @motorex #MotoGP #KTM #ReadyToRace

@MXGP | MXGP moto winners in Holland as Cairoli takes 2nd

Red Bull KTM Factory Racing own both motos at a hot, sunny Oss as Jeffrey Herlings and Tony Cairoli take the checkered flags at MXGP round four. Cairoli raises his third podium trophy of the year with 2nd place overall on his KTM 450 SX-F. The Italian is now joint 2nd in the championship.

#ReadyToRace #MXGP #motocross #MXGPNetherlands #KTM @antoniocairoli @redbullmotorsports

@mxgp | Herlings wins on home sand but then has to withdraw at Oss

A small fracture in his left shoulder blade forces the first moto winner to end his participation at the MXGP of the Netherlands. Jeffrey Herlings was superb on his KTM 450 SX-F to gain another 25 points in an action-packed first sprint but now has to recover asap for the Czech Grand Prix next weekend

#ReadyToRace #MXGP #motocross #MXGPNetherlands #KTM @jeffrey_herlings84 @redbullmotorsports

@mxgp | Prado just misses Dutch GP podium

Jorge Prado was close to his first trophy of 2021 and missed out on the overall top three at Oss by just one point. The Spaniard led 13 of 16 laps in the second moto and sits 5th in the MXGP championship table.

#ReadyToRace #MXGP #motocross #MXGPNetherlands #KTM @jorgeprado61

@mxgp | Hofer makes the top five in the Oss sand

5th overall for Rene Hofer after a strong first moto finish of 4th on the KTM 250 SX-F and Mattia Guadagnini scores 10th after pushing to 5th in the second race. Mattia is 2nd in the standings and five points from his second red plate of 2021.

